import { Table } from 'antd';

const TableUI = ({data}) => {
  const columns = [
    {
      title: 'Vendor',
      dataIndex: ['transaction_details', 'vendor'],
      width: 150,
    },
    {
      title: 'Total',
      dataIndex: ['transaction_details', 'total'],
      width: 150,
    },
    {
      title: 'Category',
      dataIndex: ['transaction_details', 'category'],
    },
  ];

  return (
    <Table columns={columns} dataSource={data} pagination={false} scroll={{ y: 240 }} />
  )

}

export default TableUI;
